import React from "react";
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faReact,faSass} from "@fortawesome/free-brands-svg-icons";

export const Code = () =>{
  return(
    <div>
      <h2>This portfolio is built the power of:</h2>
      <p><FontAwesomeIcon className='fa-3x' icon={faReact}/> <FontAwesomeIcon className='fa-3x' icon={faSass}/></p>
    </div>
  )
}
